import Accordion from 'react-bootstrap/Accordion';
import { useEffect, useState } from "react";
import { Link } from "react-router-dom";

import BrainBoosters from './Supplements/BrainBoosters.js';
import HeartHealth from './Supplements/HeartHealth.js';
import JointHealth from './Supplements/JointHealth.js';
import LiverTonic from './Supplements/LiverTonic.js';
import NaturalAntiOxidants from './Supplements/NaturalAntiOxidants.js';
import HormonesOralContraceptives from './Supplements/HormonesOralContraceptives.js';
import SlimmingWeightMgmt from './Supplements/SlimmingWeightMgmt.js';


function Product () {

    const [pageStatus, setPageStatus] = useState("");
    
    const clickHandler = (message) => {
        setPageStatus(message);
    }
    
    useEffect(() => {
        const page = window.localStorage.getItem('pageStatus');
        setPageStatus(JSON.parse(page));
        console.log(pageStatus);
      }, []);
    
    useEffect(() => {
       window.localStorage.setItem('pageStatus', JSON.stringify(pageStatus));
       
    }, [pageStatus]);


    return (
        <>
            <div className="container section product">
                <div className="row">
                    <div className="col-12 col-sm-4">

                        <Accordion defaultActiveKey="0" flush>
                            <Accordion.Item eventKey="0">
                                <Accordion.Header>Supplements</Accordion.Header>
                                <Accordion.Body>
                                    <ul>
                                        <li><Link to="/products/brain-boosters-memory-enhancers" onClick={() => clickHandler("BB")} className={`${((pageStatus === "BB") || (pageStatus === "")) ? 'itemActive' : ''}`}>Brain boosters/memory enhancers </Link></li>
                                        <li><Link to="/products/heart-health" onClick={() => clickHandler("HH")} className={`${pageStatus === "HH" ? 'itemActive' : ''}`}>Heart health </Link></li>
                                        <li><Link to="/products/joint-health" onClick={() => clickHandler("JH")} className={`${pageStatus === "JH" ? 'itemActive' : ''}`}>Joint health </Link></li>
                                        <li><Link to="/products/liver-tonic" onClick={() => clickHandler("LT")} className={`${pageStatus === "LT" ? 'itemActive' : ''}`}>Liver tonic </Link></li>
                                        <li><Link to="/products/natural-antioxidants" onClick={() => clickHandler("NAO")} className={`${pageStatus === "NAO" ? 'itemActive' : ''}`}>Natural anti-oxidants </Link></li>
                                        <li><Link to="/products/hormones-oral-contraceptives" onClick={() => clickHandler("HOC")} className={`${pageStatus === "HOC" ? 'itemActive' : ''}`}>Hormones/Oral contraceptives </Link></li>
                                        <li><Link to="/products/slimming-weight-management" onClick={() => clickHandler("SWM")} className={`${pageStatus === "SWM" ? 'itemActive' : ''}`}>Slimming/weight management </Link></li>
                                    </ul>
                                </Accordion.Body>
                            </Accordion.Item>
                            <Accordion.Item eventKey="1">
                                <Accordion.Header>Injury</Accordion.Header>
                                <Accordion.Body>
                                    <ul>
                                        <li><Link href="#/" target="_blank" rel="noreferrer noopener">Blunt trauma / Bruising </Link></li>
                                        <li><Link href="#/" target="_blank" rel="noreferrer noopener">Muscle relaxants </Link></li>
                                        <li><Link href="#/" target="_blank" rel="noreferrer noopener">Wound healing </Link></li>
                                    </ul>
                                </Accordion.Body>
                            </Accordion.Item>
                            <Accordion.Item eventKey="2">
                                <Accordion.Header>Illness</Accordion.Header>
                                <Accordion.Body>
                                    <ul>
                                        <li><Link href="#/" target="_blank" rel="noreferrer noopener">Cough & Cold preparations </Link></li>
                                        <li><Link href="#/" target="_blank" rel="noreferrer noopener">Ear, nose & throat preparations </Link></li>
                                        <li><Link href="#/" target="_blank" rel="noreferrer noopener">Urinary incontinence </Link></li>
                                    </ul>
                                </Accordion.Body>
                            </Accordion.Item>
                            <Accordion.Item eventKey="3" className="singleItem">
                                <Accordion.Header>
                                    <Link href="#/" target="_blank" rel="noreferrer noopener">Dermatological </Link>
                                </Accordion.Header>
                            </Accordion.Item>
                            <Accordion.Item eventKey="4" className="singleItem">
                                <Accordion.Header>
                                    <Link href="#/" target="_blank" rel="noreferrer noopener">Disinfectant </Link>
                                </Accordion.Header>
                            </Accordion.Item>
                            <Accordion.Item eventKey="5" className="singleItem">
                                <Accordion.Header>
                                    <Link href="#/" target="_blank" rel="noreferrer noopener">Medical Tools </Link>
                                </Accordion.Header>
                            </Accordion.Item>
                        </Accordion>
                    </div>


                    <div className="col-12 col-sm-8">

                        {
                            pageStatus === "BB" ? (
                                <BrainBoosters />
                            ) : pageStatus === "HH" ? (
                                <HeartHealth />
                            ) : pageStatus === "JH" ? (
                                <JointHealth />
                            ) : pageStatus === "LT" ? (
                                <LiverTonic />
                            ) : pageStatus === "NAO" ? (
                                <NaturalAntiOxidants />
                            ) : pageStatus === "HOC" ? (
                                <HormonesOralContraceptives />
                            ) : pageStatus === "SWM" ? (
                                <SlimmingWeightMgmt />
                            ) : (
                                <BrainBoosters />
                            )
                        }

                    </div>
                </div>
            </div>





        </>
    );
}


export default Product;
